import styled from "styled-components";

export const MainContainer = styled.main`
  margin: 0;
  padding: 0;
  width: 100%;
`

export const ListContainer = styled.section`
  display: flex;
  flex-direction: column;
  flex-wrap: wrap;

  @media (min-width: 768px){
    flex-direction: row;


  }

`
